  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the McGregor
  District of the Upper Mississippi River National Wildlife and Fish Refuge summarizes
  Refuge activities during the 1999 fiscal year.  The report begins with an introduction
  to the Refuge and a summary of the yearu2019s highlights and climatic conditions.
  \ Information about monitoring and studies- including surveys and censuses- is provided
  next.  Habitat restoration and management projects are also covered; activities
  include moist soil management, mowing, farming, timber management, fire management,
  and vegetation control.  Fish and wildlife management is discussed next with emphasis
  on nest structures and pest control.  Coordination activities, such as interagency
  coordination and private land activities, are outlined.  The resource protection
  section provides information about law enforcement, permits, and land acquisition
  support.  Information about public education and recreation is given including visitor
  services, outreach, hunting, trapping, and fishing. Refuge planning and administration-
  including general administration, safety, maintenance, volunteers, and personnel-
  are discussed. The wildlife section is discusses endangered species, threatened
  species, waterfowl, marsh birds, shorebirds, raptors, fisheries resources, and wildlife
  diversity.  Finally, items of interest are provided.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
